
const clientes = [];

document.addEventListener('DOMContentLoaded', () => {
  const botoesServicos = document.querySelectorAll('.botoes-servicos button');
  const precoInput = document.getElementById('preco');

  // Clique nos botÃµes de serviÃ§o
  botoesServicos.forEach(botao => {
    botao.addEventListener('click', () => {
      botao.classList.toggle('selected');

      const precoServico = parseFloat(botao.dataset.preco);
      let precoAtual = parseFloat(precoInput.value) || 0;

      if (botao.classList.contains('selected')) {
        precoAtual += precoServico;
      } else {
        precoAtual -= precoServico;
      }

      precoInput.value = precoAtual.toFixed(2);
    });
  });
});

// ðŸ”¹ FunÃ§Ã£o para pegar serviÃ§os selecionados
function getServicosSelecionados() {
  const selecionados = [];
  const botoesServicos = document.querySelectorAll('.botoes-servicos button');
  botoesServicos.forEach(botao => {
    if (botao.classList.contains('selected')) {
      selecionados.push(botao.dataset.servico);
    }
  });
  return selecionados;
}

// ðŸ”¹ Resetar seleÃ§Ã£o
function resetServicos() {
  const botoesServicos = document.querySelectorAll('.botoes-servicos button');
  botoesServicos.forEach(botao => botao.classList.remove('selected'));
  document.getElementById('preco').value = "0.00";
}

// ðŸ”¹ Adicionar cliente na tabela
function adicionarCliente() {
  const nome = document.getElementById('nomeCliente').value;
  const linhaNome = document.getElementById('nomeCliente');
  const linhaPreco = document.getElementById('preco');
  const preco = parseFloat(document.getElementById('preco').value);
  const servicos = getServicosSelecionados();
  const divErro = document.getElementById('mensagemErro');

  if (!nome || servicos.length === 0 || isNaN(preco)) {
    divErro.innerText = "Preencha todos os campos corretamente!";
    divErro.style.color = "red";
    linhaNome.style.borderColor = "red";
    linhaPreco.style.borderColor = "red";
    return;
  }

  const servicosStr = servicos.join(' + ');
  clientes.push({ nome, servicos: servicosStr, preco });

  const tbody = document.getElementById('tabelaClientes').querySelector('tbody');
  const row = tbody.insertRow();
  row.insertCell(0).innerText = nome;
  row.insertCell(1).innerText = servicosStr;
  row.insertCell(2).innerText = preco.toFixed(2);

  document.getElementById('nomeCliente').value = '';
  document.getElementById('preco').value = '';
  resetServicos();
}

// ðŸ”¹ FunÃ§Ã£o para formatar data em DD/MM/AAAA
function formatarData(d) {
  const dia = String(d.getDate()).padStart(2, "0");
  const mes = String(d.getMonth() + 1).padStart(2, "0");
  const ano = d.getFullYear();
  return `${dia}/${mes}/${ano}`;
}

// ðŸ”¹ Gerar PDF
function gerarPDF() {
  const dataSemana = document.getElementById('dataSemana').value;
  const dataSemanaInput = document.getElementById('dataSemana');
  const divErro = document.getElementById('mensagemErro');

  if (!dataSemana) {
    divErro.innerText = "Por favor, selecione a semana.";
    divErro.style.color = "red";
    dataSemanaInput.style.borderColor = "red";
    return; 
  }

  // Criar range da semana
  const dataInicio = new Date(dataSemana);
  const dataFim = new Date(dataInicio);
  dataFim.setDate(dataFim.getDate() + 6);

  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();

  // ðŸ”¹ Logo (coloca tua logo em Base64 aqui se quiser)
  const logoBase64 =  "data:image/png;base64,"; 
  if (logoBase64) {
    doc.addImage(logoBase64, 'JPG', 150, 10, 40, 40);
  }

  // ðŸ”¹ TÃ­tulo + semana
  doc.setFontSize(16);
  doc.text(`Semana de ${formatarData(dataInicio)} Ã  ${formatarData(dataFim)}`, 14, 35);

  // ðŸ”¹ Dados da tabela
  const colunas = ["Nome da Cliente", "ServiÃ§o(s)", "PreÃ§o"];
  const linhas = clientes.map(c => [c.nome, c.servicos, `â‚¬${c.preco.toFixed(2)}`]);

  // ðŸ”¹ Total
  const total = clientes.reduce((acc, c) => acc + c.preco, 0);

  // ðŸ”¹ Tabela
  doc.autoTable({
    head: [colunas],
    body: linhas,
    startY: 50,
    styles: { fontSize: 12 },
    headStyles: { fillColor: [250, 2, 210], textColor:[255, 255, 255] },
    foot: [[
      { content: "TOTAL", colSpan: 2, styles: { halign: "left" } },
      { content: `â‚¬${total.toFixed(2)}`, styles: { halign: "right" } }
    ]],
    footStyles: { fillColor: [250, 2, 210], textColor:[255, 255, 255] }
  });

  // ðŸ”¹ EspaÃ§o para assinaturas no rodapÃ©
  const pageHeight = doc.internal.pageSize.getHeight();

  // Assinatura da cabeleireira
  doc.setFontSize(12);
  doc.text("_________________________", 20, pageHeight - 40);
  doc.text("Assinatura da Cabeleireira", 20, pageHeight - 30);

  // Assinatura da mÃ£e (com imagem se tiver)
  const assinaturaMaeBase64 = "data:image/png;base64,"; // coloca aqui a imagem da assinatura em Base64
  if (assinaturaMaeBase64) {
    doc.addImage(assinaturaMaeBase64, 'PNG', 120, pageHeight - 55, 60, 25);
  } else {
    doc.text("_________________________", 120, pageHeight - 40);
  }
  doc.text("Assinatura da ProprietÃ¡ria", 130, pageHeight - 25);

  // ðŸ”¹ Salvar PDF
  doc.save(`Fatura de ${formatarData(dataInicio)} Ã  ${formatarData(dataFim)}.pdf`);

}
